import React from "react";
import  "./sannefa.css"
import  delice from "./freelben.jpg"
import  mazraa from "./mazraa.jpg"
import nadhif from "./Nadhif-tunisie-2.jpg"
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';

const Advertsment = () => {
  return (
    <div classname="" >
       <Carousel>
                <div>
                    <img src={nadhif} />

                </div>
                <div>
                    <img src={mazraa} />

                </div>
                <div>
                    <img src={delice}/>

                </div>
            </Carousel>

  </div>
  );
}
export default Advertsment;
